import React, { useState } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import AcademicsPopup from './components/AcademicsPopup';
import FacultyPopup from './components/FacultyPopup';
import ResearchPopup from './components/ResearchPopup';
import AdmissionsPopup from './components/AdmissionsPopup';
import FacilitiesPopup from './components/FacilitiesPopup';
import StudentsPopup from './components/StudentsPopup';
import HostelsPopup from './components/HostelsPopup';
import AboutPopup from './components/AboutPopup';

function CustomNavbar({ stickyClass, navbarOpacity }) {
  const [isHovering, setIsHovering] = useState({});

  const handleMouseEnter = (item) => {
    setIsHovering({ ...isHovering, [item]: true });
  };

  const handleMouseLeave = (item) => {
    setIsHovering({ ...isHovering, [item]: false });
  };

  return (
    <Navbar expand="lg" className={`w-100 ${stickyClass || 'position-absolute'}`} style={{ opacity: navbarOpacity }}>
      <Container>
        <Navbar.Toggle aria-controls='basic-navbar-nav' />
        <Navbar.Collapse id='basic-navbar-nav'>
          <Nav className='me-auto justify-content-center w-100'>
            {/* Academics */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('academics')} onMouseLeave={() => handleMouseLeave('academics')}>
              <span className='text-uppercase'>Academics</span>
              {isHovering.academics && <AcademicsPopup />}
            </div>
            
            {/* Faculties */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('faculties')} onMouseLeave={() => handleMouseLeave('faculties')}>
              <span className='text-uppercase'>Faculties</span>
              {isHovering.faculties && <FacultyPopup />}
            </div>

            {/* Research */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('research')} onMouseLeave={() => handleMouseLeave('research')}>
              <span className='text-uppercase'>Research</span>
              {isHovering.research && <ResearchPopup />}
            </div>

            {/* Admissions */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('admissions')} onMouseLeave={() => handleMouseLeave('admissions')}>
              <span className='text-uppercase'>Admissions</span>
              {isHovering.admissions && <AdmissionsPopup />}
            </div>

            {/* Facilities */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('facilities')} onMouseLeave={() => handleMouseLeave('facilities')}>
              <span className='text-uppercase'>Facilities</span>
              {isHovering.facilities && <FacilitiesPopup />}
            </div>

            {/* Student Life */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('studentsLife')} onMouseLeave={() => handleMouseLeave('studentsLife')}>
              <span className='text-uppercase'>Student Life</span>
              {isHovering.studentsLife && <StudentsPopup />}
            </div>

            {/* Hostels & Accommodations */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('hostels')} onMouseLeave={() => handleMouseLeave('hostels')}>
              <span className='text-uppercase'>Hostels & Accommodations</span>
              {isHovering.hostels && <HostelsPopup />}
            </div>

            {/* About */}
            <div className='nav-item' onMouseEnter={() => handleMouseEnter('about')} onMouseLeave={() => handleMouseLeave('about')}>
              <span className='text-uppercase'>About</span>
              {isHovering.about && <AboutPopup />}
            </div>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
);

}

export default CustomNavbar;
